import { render } from "@testing-library/react";
import React from "react";
import './Menu.css'

const Menu = ({header, items}) => {
    const cont = [
        {
          whatsapp: '8 *** ** **',
          telegram: '8 *** ** **',
          instagram: '@cherlston'
        }
      ]
    render(
        <div className="menu">
            <div className="blur"/>
            <div className="menu__content">
                <div className="menu__header">{header}</div>
                <ul>
                    {cont.map(contact => 
                        <li>
                            <a>{contact.whatsapp}</a>
                            <a>{contact.whatsapp}</a>
                            <a>{contact.whatsapp}</a>
                        </li>
                    )}
                </ul>
            </div>
        </div>
    );
};

export default Menu
